import React from "react";
import { productsData } from "../assets/projectsData";

const Product = () => {
  return (
    <div className="product-container">
      <h1> Products</h1>
      <div className="products">
        {productsData.map((products) => (
          <div key={products._id} className="">
            <img src={products.img} alt={products.title} className="" />
            <h2>{products.title}</h2>
            <p className="products-category">{products.category}</p>
            <p className="products-desc">{products.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Product;
